import { useState } from 'react';
import { Button } from 'antd';

function UseState() {
  const [val, setVal] = useState('');
  
  return (
    <>
      <h1>{val}</h1>
      <Button onClick={() => { setVal('Clicked!'); }}>Change</Button>
    </>
  );
}
export default UseState;
